import './style.css';
import image from './image/1.jpg'
import SignIn from './components/signIn';
import SignUp from './components/signUp'
class App extends React.Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <div id="image">
            <img src={image} />
          </div>
          < SignIn />
        </div>
      </div>
    );
  }
};


export default App;
